    $templateCache.put("fn/partials/landing/index.html", "<main id=\"landing\">\n    <div id=\"head\">\n        <h1 class=\"fn-icon-create-post\" alt=\"FINAO - Failure Is Not An Option\"></h1>\n        <a du-parallax custom=\"scrollHugger\" ui-sref=\"fn.signup-with-ref({ ref: 'homepage' })\" class=\"join btn btn-success\">Join Us</a>\n        <p class=\"subheading\">My life's journey is filled with setbacks, joys, friendships, growth...It's all me!</p>\n        <p class=\"caption\">~Failure Is Not An Option.</p>\n    </div>\n\n    <div id=\"profile\" class=\"landingSection\">\n        <h2 class=\"heading\">Do your thing in a drama-free &amp; ad-free zone. <span>It's all you.</span></h2>\n        <p class=\"subheading\">Don't live in the digital world. Post, get motivated and go be you.</p>\n    </div>\n\n    <div id=\"step-1\" class=\"landingSection\">\n        <p class=\"number\" du-parallax custom=\"scrollCounter\">1.</p>\n        <h3>Create FINAOs</h3>\n        <p class=\"description\">FINAOs are the things in your life where you and only you decide that Failure Is Not An Option. Create FINAOs and start your journey.</p>\n        <ul class=\"finaos list-unstyled\">\n            <li class=\"finaoStatusList\" ng-repeat=\"finao in mockData.finaos\" finao=\"finao\" fn-tile=\"finao.tile\" me=\"me\" user=\"{}\"></li>\n        </ul>\n    </div>\n    <div id=\"step-2\" class=\"landingSection\">\n        <p class=\"number\" du-parallax custom=\"scrollCounter\">2.</p>\n        <h3>Update Your FINAOs</h3>\n        <p class=\"description\">Keep your FINAOs up to date by posting text, pictures and videos. Change your status along the way, keeping it real.</p>\n        <div class=\"finaoPostList\">\n            <div class=\"finaoPost\" ng-repeat=\"post in mockData.posts | orderBy:predicate\" finao-post=\"post\" me=\"me\" on-deleted=\"removePost(postDeleted)\"></div>\n            <div class=\"finaoStatusWrapper\">\n                <p class=\"description\">Update your status with each post to show whether youâ€™re Behind, On Track or Ahead.</p>\n                <div class=\"finaoStatusList\">\n                    <ul class=\"list-unstyled\">\n                        <li ng-repeat=\"status in statuses\">\n                            <a class=\"btn\" ng-class=\"status\">{{status}}</a>\n                        </li>\n                    </ul>\n                </div>\n            </div>\n        </div>\n    </div>\n    \n    <div id=\"step-3\" class=\"landingSection\">\n        <p class=\"number\" du-parallax custom=\"scrollCounter\">3.</p>\n        <h3>Build Your FINAO Community</h3>\n        <p class=\"description\">Shape your community based on what interests you. Become inspired while others are inspired by you.</p>\n        <div class=\"inspiredFollowing\">\n            <div class=\"following\">\n                <p class=\"description\">Follow FINAOs that interest you.</p>\n                <div class=\"borderWrapper\">\n                    <span class=\"fn-icon-logo\"></span>\n                </div>\n            </div>\n            <div class=\"inspired\">\n                <p class=\"description\">Be inspired when people post about their progress.</p>\n                <div class=\"borderWrapper\">\n                    <span class=\"fn-icon-inspired\"></span>\n                </div>\n            </div>\n        </div>\n    </div>\n\n    <div id=\"videos\" class=\"landingSection\">\n        <h3>Videos</h3>\n        <div class=\"videoWrapper\">\n            <vimeo-video video-id=\"110159703\" class=\"video\"></vimeo-video>\n            <vimeo-video video-id=\"108551036\" class=\"video\"></vimeo-video>\n            <vimeo-video video-id=\"108551037\" class=\"video\"></vimeo-video>\n        </div>\n    </div>\n\n    <div id=\"gear\" class=\"landingSection\">\n        <img id=\"get-it-in-gear-svg\" src=\"/skin/frontend/social/default/images/landing/get-in-gear.svg\">\n        <img id=\"get-it-in-gear-png\" src=\"/skin/frontend/social/default/images/landing/get-in-gear.png\">\n        <p class=\"description\">As you build upon your personal journey, remember not to be tied down by the digital world. Post, stay motivated, and go be you. Your FINAO Gear provides you the reminder that, no matter where you are, you have a place to go to be yourself where, by your own definition of success,<br /> Failure Is Not An Option.</p>\n        <div class=\"buttons\">\n            <a href=\"/gear.html\" class=\"btn btn-primary shop\">shop</a>\n        </div>\n    </div>\n</main>\n\n<footer></footer>\n");
